import { Link } from "react-router-dom";

function Navbar() {
    return (
        <div>
            <nav>
                <Link to="">Home</Link>
                <Link to="About">About</Link>
                <Link to="Links">Links</Link>
            </nav>
        </div>
    )
}

export default Navbar;
